textOriginal:
@Brasil de Fato,  *muitíssimo obrigada por sua importantíssima contribuição,  ao longo destes tão difíceis anos,  para a vitória da democracia e da população brasileira neste momento tão delicado da nação!*

*Este foi o primeiro passo:  conto(amos) muitíssimo com vocês para o longo e árduo trabalho que nos espera para a reconstrução do Brasil e para termos um dia uma sociedade justa,  humana,  igualitária.*

🤗🌷🕊

@Marina Silva *terá importantíssimo trabalho a desenvolver no novo governo,  tanto na proteção do meio ambiente e dos povos originários,  quanto na sua exploração para o desenvolvimento sadio da produção agropastoril e das riquezas naturais brasileiras.*

*Parabéns,*  @Marina Silva,  *e muito obrigada por tudo o que já fez pelo Brasil e por todos nós,  brasileiros.*

*Você também faz parte da vitória da democracia neste momento tão delicado da nação.*  🤗🌷🕊
